import React, {useEffect, useState} from 'react';
import {Text,View, StyleSheet} from 'react-native';
import Cat from './Cat';
import Bubble from './DialogBubble';
import NameTag from './NameTag';

const HomeScreen = () => {
    const [adoptday] = useState(233)
    return(
        <View style={styles.container}>
            <Text style={styles.welcomeText}>Happy Monday!</Text>
            {/* add: change according to date */}
            <View style={styles.container2}>
                <View><NameTag name='James' days={adoptday} /></View>
                <Bubble text='Hi'/>
            </View>
            <Cat />
        </View>  
    )
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        margin: 10,
        alignItems: 'center',
        justifyContent: 'center',
        //add background paper shape here
      },
    container2: {
        flexDirection: 'row',
        justifyContent:'space-between',
    },
    welcomeText: {
        margin: 10,
    },
})

export default HomeScreen;
